import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <footer>
      <p>Адрес: г. Санкт-Петербург, Витебский пр., 13, к.13 Телефон: (812) 33-22-000</p>
    </footer>
  );
};

export default Footer;
